import React from 'react'
import Textfield from '../../components/TextField/TextField'
import Slider from '../../components/Slider/Slider'


const TextField = () => {
    return (
        <div>
            <Slider />
            <Textfield value=""/>
            <Textfield value='Disabled' />
            <Textfield value='101' error="Error" />
        </div>
    )
}
export default TextField;
